import React from 'react'
import LiquorCategory from './LiquorCategory'

function Whiskey( {whiskeys}) {
  return (
    <div className='component blog'>
        <p className='first'>Whiskey</p>
        <p>There are {whiskeys.length} products.</p>
        {whiskeys.map(whiskey => (
        <div id='liquor' key={whiskey.id}>
        <main>
            <img src={whiskey.image} alt={whiskey.title} />
            <p style={{textAlign: "center"}}> 
                Rating : {whiskey.rating}/5 <br />
                {whiskey.title} <br />
                {whiskey.description}
                Ksh.{whiskey.price}
            </p>
        </main>
    </div>
    ))}
    </div>
  )
}

export default Whiskey
